import React from 'react';
import ReactDOM from 'react-dom';
import '../index.css';
import '../App.css';

const ItemList=(props)=>{
    return(
    <div className='item-div-list' onClick={props.action}> 
      <p>{`Item:${props.name}`}</p>
     <p>{`Price:${props.price}`}</p>
     </div>
    )
}
export default ItemList;
